import React from 'react'

function CommentsMatch() {
    return (
        <div>
            <span style={{
                background: "#E5007D", width: "45%", padding: 10, color: "#fff", display: "inline-block", textAlign: "center", fontSize: 13, margin: 0
            }}>Matched</span>
            <span style={{ background: "#E9E9EB", width: "45%", padding: 10, color: "#818E94", display: "inline-block", textAlign: "center", fontSize: 13, margin: 0 }}>Not matched</span>
        </div>
    )
}

export default CommentsMatch
